/**
 * Input output operations
 */

import fs from 'fs';

/**
 * Return an array of filenames in a directory.
 * Optionally, you can specific an extension
 * @param dir Path to directory.
 * @param ext (Optional) Filter by file extension.
 * @param removeExt (Optional) Remove the file extension from the filename string.
 */
const listFilesInDirSync = (
  dir: string,
  {
    ext = null,
    removeExt = false,
  }: { ext?: string | null; removeExt?: boolean } = {}
): string[] | null => {
  if (typeof dir !== 'string') {
    throw new TypeError("Argument 'dir' must be a string.");
  }

  if (ext !== null && typeof ext !== 'string') {
    throw new TypeError("Argument 'ext' must be a string.");
  }

  if (typeof removeExt !== 'boolean') {
    throw new TypeError("Argument 'removeExt' must be a boolean.");
  }

  if (!fs.existsSync(dir)) {
    throw new ReferenceError('Directory does not exist.');
  }

  const fileList = fs.readdirSync(dir);

  if (!removeExt) {
    // Don't remove file extensions
    if (ext === null) {
      // Don't filter by file extension
      return fileList;
    }
    // Filter by file extension
    return fileList.filter((fileName) => fileName.lastIndexOf(ext) >= 0);
  }

  // Remove file extensions
  if (ext === null) {
    // Remove all extensions
    const regexRemoveExt = /^(?:.+?)(?:\.[^.]*$|$)/;
    const filteredList = fileList.map((e) => e.match(regexRemoveExt));
    if (filteredList === null) {
      return null;
    }
    return filteredList[0];
  }

  // Filter by extension and remove file extensions
  return fileList
    .filter((filename) => filename.lastIndexOf(ext) >= 0)
    .map((fileName) => fileName.substr(0, fileName.lastIndexOf(ext)));
};

/**
 * Loading a file to stream buffer
 * @param filePath Path to file
 */
const loadFile = (filePath: string): Promise<string> =>
  new Promise<string>((resolve, reject) => {
    if (typeof filePath !== 'string') {
      reject(new TypeError("Argument 'filePath' must be a string."));
      return;
    }

    const stream = fs.createReadStream(filePath);
    stream
      .on('data', (buffer) => {
        resolve(buffer.toString());
      })
      .on('error', (err) => {
        reject(err);
      });
  });

/**
 * Read a file and write its content to another file
 * @param fileToRead Path to the file to be read
 * @param fileToWrite Path to the file to be written
 */
const readPipeWrite = (
  fileToRead: string,
  fileToWrite: string
): Promise<string> =>
  new Promise<string>((resolve, reject) => {
    if (typeof fileToRead !== 'string') {
      reject(new TypeError("Argument 'fileToRead' must be a string."));
      return;
    }
    if (typeof fileToWrite !== 'string') {
      reject(new TypeError("Argument 'fileToWrite' must be a string."));
      return;
    }

    const readStream = fs.createReadStream(fileToRead).on('error', (err) => {
      reject(err);
    });
    const writeStream = fs.createWriteStream(fileToWrite).on('error', (err) => {
      reject(err);
    });
    readStream.pipe(writeStream).on('finish', () => {
      resolve(
        `Successfully read ${fileToRead} and wrote its content to ${fileToWrite}.`
      );
    });
  });

/**
 * Write content to file
 * @param filePath Path to the file to be written
 * @param content Content to be written
 */
const writeToFile = (filePath: string, content: string): Promise<string> =>
  new Promise<string>((resolve, reject) => {
    if (typeof content !== 'string') {
      reject(new Error("Argument 'content' must be a string."));
      return;
    }
    if (typeof filePath !== 'string') {
      reject(new Error("Argument 'filePath' must be a string."));
      return;
    }

    fs.writeFile(filePath, content, 'utf8', (err) => {
      if (err) {
        reject(err);
        return;
      }
      resolve(`Successfully wrote to ${filePath}.`);
    });
  });

export { listFilesInDirSync, loadFile, readPipeWrite, writeToFile };

/**
 * Helper functions that don't fit into other categories
 */

/**
 * Run an array of functions with the same set of argument(s)
 * @param funcs An array of functions.
 * @param args An array of arguments. Each element of the array will
 * be presented to each function.
 * @param spread If 'args' is an array of arrays, you can choose to
 * expand each sub-array with the spread operator. Default is false.
 * @return
 */
const runFuncsWithArgs = (
  funcs: ((...args: any | any[] | null) => any)[],
  args: any | any[] | null = null,
  spread = false
): any[] => {
  if (!Array.isArray(funcs)) {
    throw new TypeError("Argument 'funcs' needs to be an array.");
  }
  if (Array.isArray(args)) {
    return args.map((a) =>
      funcs.map((f) => (spread && Array.isArray(a) ? f(...a) : f(a)))
    );
  }
  if (args === null) {
    return funcs.map((f) => f(args));
  }
  if (spread) {
    return funcs.map((f) => f(...args));
  }
  return funcs.map((f) => f(args));
};

/**
 * Returns the value in an array or an object (or you call it JSON, a hash map
 * or a dictionary) provided keys and/or indices pointing to the value.
 * @param obj An array, an object (or you call it JSON, a hash map or a
 * dictionary) or a combination.
 * @param k An arbitrary number of indices and/or keys pointing to the value.
 * For example, if `x = {name: 'Tom'}`, to fetch value `'Tom'`, use
 * `valOfKeysAndIndicies(x, 'name')`.
 * If `y = { key0: [{ key1: [3.142, 6.626,] },] }`, to fetch `6.626`, use
 * `valOfKeysAndIndicies(y, 'key0', 0, 'key', 1)`.
 * @return The value from the given indices/keys.
 */
const valOfKeysAndIndices = (obj: any, ...k: (string | number)[]): any => {
  if (k.length === 0) {
    return obj;
  }
  if (k.length === 1) {
    return obj[k[0]];
  }
  return valOfKeysAndIndices(obj[k[0]], ...k.slice(1));
};

export { runFuncsWithArgs, valOfKeysAndIndices };

/**
 * Sorting algorithms
 */

import { valOfKeysAndIndices } from './others';

/**
 * Compare function for comparing lexicographic order
 * @param ignoreCase Ignore the case of the given string.
 * @param descending True for descending order, false for
 * ascending order
 * @param key An array of indices and/or keys pointing to the value for
 * comparison.
 * For example, if `x = {name: 'Tom'}`, use `comparatorLexic({key = 'name'})`
 * to fetch value `'Tom'` for comparison.
 * If `x = { key0: [{ key1: [Earth, Mars,] },] }`, to fetch `Mars` for
 * comparison, use `comparatorLexic({key = ['key0', 0, 'key', 1]})`.
 * See valOfKeysAndIndices for more details.
 */
const comparatorLexic = ({
  key = null,
  ignoreCase = false,
  descending = false,
}: {
  key?: (string | number)[] | null;
  ignoreCase?: boolean;
  descending?: boolean;
} = {}) => (x: any, y: any): number => {
  let a = '';
  let b = '';

  if (key === null) {
    a = x.toString();
    b = y.toString();
  } else if (typeof key === 'string' || typeof key === 'number') {
    a = x[key];
    b = y[key];
  } else if (Array.isArray(key)) {
    a = valOfKeysAndIndices(x, ...key);
    b = valOfKeysAndIndices(y, ...key);
  } else {
    throw new Error("Invalid argument 'key'.");
  }

  if (ignoreCase) {
    a = a.toUpperCase();
    b = b.toUpperCase();
  }

  if (descending) {
    if (a < b) return 1;
    if (a > b) return -1;
    return 0;
  }
  // if ascending
  if (a < b) return -1;
  if (a > b) return 1;
  return 0;
};

/**
 * Compare function for comparing numerical order
 * @param ignoreSign Ignore the sign of the number, i.e. use the absolute
 * value for comparison.
 * @param descending True for descending order, false for
 * ascending order
 * @param key An array of indices and/or keys pointing to the value
 * for comparison.
 * If `x = { key0: [{ key1: [3.142, 6.626,] },] }`, to fetch `6.626` for
 * comparison, use `comparatorLexic({key = ['key0', 0, 'key', 1]})`.
 * See valOfKeysAndIndices for more details.
 */
const comparatorNumeric = ({
  key = null,
  ignoreSign = false,
  descending = false,
}: {
  key?: (string | number)[] | null;
  ignoreSign?: boolean;
  descending?: boolean;
} = {}) => (x: any, y: any): number => {
  let a: number;
  let b: number;

  if (key === null) {
    a = x;
    b = y;
  } else if (typeof key === 'string' || typeof key === 'number') {
    a = x[key];
    b = y[key];
  } else if (Array.isArray(key)) {
    a = valOfKeysAndIndices(x, ...key);
    b = valOfKeysAndIndices(y, ...key);
  } else {
    throw new Error("Invalid argument 'key'.");
  }

  if (ignoreSign) {
    a = Math.abs(a);
    b = Math.abs(b);
  }

  if (descending) {
    if (a < b) return 1;
    if (a > b) return -1;
    return 0;
  }
  // if ascending
  if (a < b) return -1;
  if (a > b) return 1;
  return 0;
};

/**
 * Bubble sort
 * Stable: yes
 * @param arr (Positional, required) An array to be sorted.
 * @param comaprator (Positional, optional) Compare function.
 * @param k (Positional, optional) Partial sorting. Once the first k
 * elements are sorted, return the results.
 * @return An sorted array
 */
const bubbleSort = (
  arr: any[],
  comparator: (a: any, b: any) => number = comparatorLexic({}),
  k: number | null = null
): any[] => {
  const ans = arr.slice(0); // Eliminate side effects
  const len = ans.length;

  for (let start = 0; start < len; start += 1) {
    for (let i = len - 1; i > start; i -= 1) {
      const cmp = comparator(ans[i - 1], ans[i]);
      if (cmp > 0) {
        const swap = ans[i];
        ans[i] = ans[i - 1];
        ans[i - 1] = swap;
      }
    }

    if (k !== null && start === k - 1) {
      return ans;
    }
  }

  return ans;
};

/**
 * Merge sort
 * Stable: yes
 * @param arr An array to be sorted
 * @param comaprator (Optional) Compare function
 * @return An sorted array
 */
const mergeSort = (
  arr: any[],
  comparator: (a: any, b: any) => number = comparatorLexic({})
): any[] => {
  if (arr.length > 1) {
    const mid = Math.floor(arr.length / 2);
    const leftArr = mergeSort(arr.slice(0, mid), comparator);
    const rightArr = mergeSort(arr.slice(mid), comparator);

    const sortedArr = [];

    let iL = 0;
    let iR = 0;

    while (iL < leftArr.length && iR < rightArr.length) {
      const cmp = comparator(leftArr[iL], rightArr[iR]);
      if (cmp > 0) {
        sortedArr.push(rightArr[iR]);
        iR += 1;
      } else {
        sortedArr.push(leftArr[iL]);
        iL += 1;
      }
    }

    return sortedArr.concat(leftArr.slice(iL)).concat(rightArr.slice(iR));
  }

  return arr;
};

/**
 * Partial sort: Get first K sorted elements
 *
 * @param arr An array to be sorted.
 * @param comparator (Optional) Compare function.
 * @return An sorted array.
 *
 * The order depends on the comparator you use.
 * For example, if you want to get the first K smallest numbers, use compare
 * function `comparatorNumeric({descending: false})`.
 * If you want to get the first K largest numbers, use compare function
 * `comparatorNumeric({descending: true})`.
 */
const partialSort = (
  arr: any[],
  comparator: (a: any, b: any) => number = comparatorLexic({}),
  k: number | null = null
) => {
  // Use bubbleSort for small arrays
  // Will implement heapSort for large arrays

  return bubbleSort(arr, comparator, k);
};

export {
  comparatorLexic,
  comparatorNumeric,
  bubbleSort,
  mergeSort,
  partialSort,
};
